import './App.css';
import About from './components/about_me';
import Footer from './components/footer';
import NavBar from './components/header';
import Intro from './components/intro';
import Skills from './components/skills';

function App() {
  return (
    <div className="App">
      <NavBar />
      <Intro />
      <About />
      <Skills />
      <Footer />
    </div>
  );
}

export default App;
